import React from "react";
import { Card, CardContent, Typography, Grid } from "@material-ui/core";
import {CountUp} from "react-countup"
import styles from "./Cards.module.css";

const Cards = ({ data: { confirmed, recovered, deaths, lastUpdate } }) => {
  console.log(confirmed, recovered, deaths, lastUpdate);
  //   console.log(data);
  if (!confirmed) {
    return "Loading...!";
  }
  return (
    <div className={styles.container}>
      <Grid container spacing={3} justify="center">
        <Grid item component={Card}>
          <CardContent>
            <Typography color="textSecondary" gutterBottom>
              Infected
            </Typography>
            <Typography variant="h5">
                <CountUp start={0} end={confirmed.value} duration={2.5} seperator=","></CountUp>
                </Typography>
            <Typography color="textSecondary" gutterBottom>{lastUpdate}</Typography>
            {/* <Typography color="textSecondary" gutterBottom>{new Date(lastUpdate).toDate}</Typography> */}
          </CardContent>
        </Grid>
      </Grid>
    </div>
  );
};

export default Cards;
